using System;\nusing DDay.iCal;\n\npublic class Program\n{\n    public static void Main()\n    {\n        // Load the calendar from a string or file\n        var iCalendar = iCalendar.Load("path_to_your_file.ics");\n\n        foreach (var calendarEvent in iCalendar.Events)\n        {\n            Console.WriteLine("Summary: " + calendarEvent.Summary);\n            Console.WriteLine("Start Time: " + calendarEvent.StartDt);\n            Console.WriteLine("End Time: " + calendarEvent.EndDt);\n            // Additional properties can be accessed similarly\n        }\n    }\n}